import styled from "styled-components";

export const ButtonContainer = styled.button`
  padding: 10px 20px;
  border: 1px solid grey;
  background-color: transparent;
  &:hover {
    cursor: pointer;
    background-color: rgb(232, 232, 232);
  }
`;
